import React, { useState } from 'react';
import axios from 'axios';
import '../styles/WeatherStyles.css';

const BACKEND_URL = 'http://localhost:5000/api';

const ExportPanel = ({ storedLocations, onClose }) => {
  const [exportFormat, setExportFormat] = useState('json');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [selectedLocation, setSelectedLocation] = useState('');
  const [exportLoading, setExportLoading] = useState(false);

  const handleExport = async () => {
    if (!startDate || !endDate) {
      alert('Please select both start and end dates');
      return;
    }

    setExportLoading(true);
    try {
      const params = new URLSearchParams({
        startDate,
        endDate,
        ...(selectedLocation && { location: selectedLocation })
      });

      const response = await axios.get(
        `${BACKEND_URL}/export/${exportFormat}?${params}`,
        { responseType: 'blob' }
      );

      // Create download link
      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', `weather-data.${getFileExtension(exportFormat)}`);
      document.body.appendChild(link);
      link.click();
      link.remove();
      window.URL.revokeObjectURL(url);

    } catch (error) {
      console.error('Export error:', error);
      alert('Failed to export data. Please try again.');
    } finally {
      setExportLoading(false);
    }
  };

  const getFileExtension = (format) => {
    const extensions = {
      json: 'json',
      csv: 'csv',
      xml: 'xml',
      pdf: 'pdf',
      markdown: 'md'
    };
    return extensions[format] || 'txt';
  };

  return (
    <div className="export-panel">
      <div className="export-header">
        <h3>ðŸ“Š Export Weather Data</h3>
        <button className="close-btn" onClick={onClose}>âœ•</button>
      </div>

      <div className="export-controls">
        <div className="form-group">
          <label>Format:</label>
          <select 
            value={exportFormat} 
            onChange={(e) => setExportFormat(e.target.value)}
          >
            <option value="json">JSON</option>
            <option value="csv">CSV</option>
            <option value="xml">XML</option>
            <option value="pdf">PDF</option>
            <option value="markdown">Markdown</option>
          </select>
        </div>

        <div className="form-group">
          <label>Start Date:</label>
          <input 
            type="date" 
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
          />
        </div>

        <div className="form-group">
          <label>End Date:</label>
          <input 
            type="date" 
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
          />
        </div>

        <div className="form-group">
          <label>Location (Optional):</label>
          <select 
            value={selectedLocation}
            onChange={(e) => setSelectedLocation(e.target.value)}
          >
            <option value="">All Locations</option>
            {storedLocations.map((loc, index) => (
              <option key={index} value={loc.name}>
                {loc.name}, {loc.country} ({loc.searchCount} searches)
              </option>
            ))}
          </select>
        </div>
      </div>

      <div className="export-actions">
        <button 
          className="export-btn"
          onClick={handleExport}
          disabled={exportLoading}
        >
          {exportLoading ? 'Exporting...' : `Export as ${exportFormat.toUpperCase()}`}
        </button>
      </div>
    </div>
  );
};

export default ExportPanel;
